import Home from "./pages/home";
import Detail from "./pages/detail";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
function App() {
  return (
    <>
    <Router>
      <Routes>
        <Route path="/" exact element={<Home/>} />
        <Route path="/admin" exact element={<Admin/>} />
        <Route path="/admin" exact element={<Admin/>} />
      </Routes>
    </Router>
    </>
  );
}

export default App;
